import React from 'react';
import styled from 'styled-components';

function SkeletonTopBanner() {
	return (
		<ComponentWrapper>
			<div className="box-img-wrapper" />
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	height: auto;
	position: relative;
	overflow: hidden;
`;

export default SkeletonTopBanner;
